import "./App.css";
import twoC from "./react_cards/2c";

function App() {
  return (
    <div className="App">
      <div className="hand hhand-compact active-hand">
        <img className="card" src={twoC} alt="two club"></img>
      </div>
    </div>
  );
}

export default App;
